import React, {useState, useEffect} from "react";

function App() {
  let [backendData, setData] = useState();
  let [isLoading , setLoad] = useState(true);
  useEffect(() => {
    fetch('/api').then(
      response => response.json()
    ).then(
      data => {
        console.log(data.name);
        setData(data);
        setLoad(false)
      }
    )
  }, []);
  return(
    <div>
      {(() => {if (isLoading) {
        return "Is Loading";
      } else {
        return backendData.name;
      }})()}
    </div>
  );
}

export default App;
